import React from 'react';
import {View, TouchableOpacity} from 'react-native';
import Icon from 'react-native-vector-icons/AntDesign';
import styles from './paginas/Telainicial/style';


export default function Routes(){ 

      return(
        <View style= {{flex:1, backgroundColor: '#FFF'}}>
            <View style={styles.view}>
                <TouchableOpacity><Icon name="home" size={30} color='#17A558'/></TouchableOpacity>
                <TouchableOpacity><Icon name="search1" size={30} color='#17A558'/></TouchableOpacity>
                <TouchableOpacity><Icon name="bell" size={30} color='#17A558'/></TouchableOpacity>
            </View>    
        </View>
      );
}
